import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter ,Route, Routes} from 'react-router-dom';
import App from './App';

ReactDOM.render(
  <BrowserRouter>
     <Route path="/" element={<App />} />
  </BrowserRouter>,
  document.getElementById('root')
);
